import React, { useEffect } from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios';

const App = () => {
  useEffect(() => {
    async function getContacts() {
      const res = await axios.get(`http://localhost:8080/api/getContacts`);
    }
  }, []);

  return <div className='App'></div>;
};

export default App;
